import React from 'react';
import Board from './components/Board';

function App() {

  return (  
    <div className="App">
      <h1 className="header">TIC TAC TOE</h1>
      <Board />
      <button onClick={() => window.location.reload(false)} style={{width:170,backgroundColor:'#00ff00',marginTop:20,}}>
                    <text style={{marginLeft:0}}>Restart Game</text>
      </button>
    </div>
  );
}


export default App;
